import { useState } from "react";
import { userData } from "./userData.js";

const UserData = () => {
  const [data, setData] = useState(userData);
  const [editRowId, setEditRowId] = useState(null); // To track which row is being edited
  const [editableData, setEditableData] = useState({}); // Store the editable data

  // Handle edit click to show input fields
  const handleEditClick = (rowData) => {
    setEditRowId(rowData.id);
    setEditableData({ ...rowData }); // Populate editableData with current row data
  };

  // Handle changes in input fields
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEditableData((prevData) => ({ ...prevData, [name]: value }));
  };

  // Save the changes and update the data
  const handleSaveClick = () => {
    setData((prevData) =>
      prevData.map((row) => (row.id === editRowId ? editableData : row))
    );
    setEditRowId(null); // Close the edit mode
  };

  // Cancel the editing, revert to original data
  const handleCancelClick = () => {
    setEditRowId(null); // Close the edit mode
  };

  return (
    <>
      <div>
        <table className="border-2 w-1/2">
          <thead>
            <tr className="h-10 bg-gray-300 text-center">
              <th>Id</th>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Location</th>
              <th>Gender</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {Array.isArray(data) &&
              data.length !== 0 &&
              data.map((row) => (
                <tr key={row.id} className="text-center">
                  <td>{row.id}</td>

                  {/* Editable Name Field */}
                  <td>
                    {editRowId === row.id ? (
                      <input
                        type="text"
                        name="name"
                        value={editableData.name}
                        onChange={handleInputChange}
                        className="border-2 py-1 px-3"
                      />
                    ) : (
                      row.name
                    )}
                  </td>

                  {/* Editable Email Field */}
                  <td>
                    {editRowId === row.id ? (
                      <input
                        type="email"
                        name="email"
                        value={editableData.email}
                        onChange={handleInputChange}
                        className="border-2 py-1 px-3"
                      />
                    ) : (
                      row.email
                    )}
                  </td>

                  {/* Editable Phone Field */}
                  <td>
                    {editRowId === row.id ? (
                      <input
                        type="text"
                        name="phone"
                        value={editableData.phone}
                        onChange={handleInputChange}
                        className="border-2 py-1 px-3"
                      />
                    ) : (
                      row.phone
                    )}
                  </td>

                  {/* Editable City Field */}
                  <td>
                    {editRowId === row.id ? (
                      <input
                        type="text"
                        name="city"
                        value={editableData.city}
                        onChange={handleInputChange}
                        className="border-2 py-1 px-3"
                      />
                    ) : (
                      row.city
                    )}
                  </td>

                  {/* Editable Gender Field */}
                  <td>
                    {editRowId === row.id ? (
                      <>
                        <input
                          type="radio"
                          id="genderMale"
                          name="gender"
                          value="Male"
                          checked={editableData.gender === "Male"}
                          onChange={handleInputChange}
                        />
                        <label htmlFor="genderMale">Male</label>
                        <input
                          type="radio"
                          id="genderFemale"
                          name="gender"
                          value="Female"
                          checked={editableData.gender === "Female"}
                          onChange={handleInputChange}
                        />
                        <label htmlFor="genderFemale">Female</label>
                      </>
                    ) : (
                      row.gender
                    )}
                  </td>

                  <td>
                    {editRowId === row.id ? (
                      <>
                        <button
                          className="bg-green-200 px-5 py-2"
                          onClick={handleSaveClick}
                        >
                          Save
                        </button>
                        <button
                          className="bg-red-200 px-5 py-2 ml-2"
                          onClick={handleCancelClick}
                        >
                          Cancel
                        </button>
                      </>
                    ) : (
                      <button
                        className="bg-green-200 px-5 py-2"
                        onClick={() => handleEditClick(row)}
                      >
                        Edit
                      </button>
                    )}
                  </td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default UserData;
